const SellerPage = () => {
  return (
    <div className="seller-page">
      <h1>Seller Dashboard</h1>
      <p>Here you can list mobile phones for sale.</p>
      {/* Add logic to add new items for sale */}
    </div>
  );
};

export default SellerPage;
